def solve(board):
    if len(board) <= 1 or len(board[0]) <= 1:
        return board
    visited = set()
    row = len(board)
    col = len(board[0])
    for i in range(row):
        if board[i][0] == "O" and (i, 0) not in visited:
            visited.add((i, 0))
            BFS(i, 0, row, col, visited, board)
    for j in range(col):
        if board[0][j] == "O" and (0, j) not in visited:
            visited.add((0, j))
            BFS(0, j, row, col, visited, board)
    for i in range(1, row - 1):
        for j in range(1, col-1):
            if board[i][j] == "O" and (i, j) not in visited:
                board[i][j] = "X"

def BFS(i, j, row, col, visited, board):
    if i-1 >= 0 and board[i-1][j] == "O" and (i-1, j) not in visited:
        visited.add((i-1, j))
        BFS(i-1, j, row, col, visited, board)
    if i+1 < row and board[i+1][j] == "O" and (i+1, j) not in visited:
        visited.add((i+1, j))
        BFS(i+1, j, row, col, visited, board)
    if j-1 >=0 and board[i][j-1] == "O" and (i, j-1) not in visited:
        visited.add((i, j-1))
        BFS(i, j-1, row, col, visited, board)
    if j+1 < col and board[i][j+1] == "O" and (i, j+1) not in visited:
        visited.add((i, j+1))
        BFS(i, j+1, row, col, visited, board)

